import Axios from "axios"

export default function CreateCookie( email ) {

    Axios( {
        method: "post",
        url: "http://www.paste.services/login/rememberMe",
        headers: {
            'Content-Type': 'application/json; charset=UTF-8'
        },
        data: {
            "email": email
        },
    } ).then( ( res ) => {

        // Successfully logged in
        if ( res.data === "OK" ) {

            // If cookie is successfully updated to database, save
            // it in user's computer/browser
            CreateCookie( email ) &&
                JsCookie.set( "rememberMe", email, { expires: 7 } )
        }
        console.log( "Response: " + res.data )
    } )
}
